import React from "react";

const index = ({ todos }) => {
    return <div>{todos}</div>;
};

index.getInitialProps = async (ctx) => {
    const res = await fetch("https://jsonplaceholder.typicode.com/todos");
    const json = await res.json();
    console.log(json);
    return {};
};
export default index;
